function initFont(doc){
        
        doc.addFileToVFS('Poppins-Regular.ttf','');
        doc.addFont('Poppins-Regular.ttf', 'pop-normal', 'normal');
        doc.addFileToVFS('Poppins-SemiBold.ttf','');
        doc.addFont('Poppins-SemiBold.ttf', 'pop-semibold', 'normal');
        doc.addFileToVFS('GreatVibes-Regular.ttf','');
        doc.addFont('GreatVibes-Regular.ttf', 'vibes', 'normal');

        return doc
}